INSERT INTO `articles` (`articles_id`, `articles_name`, `articles_content`, `articles_locked`, `articles_type`, `join_id`) VALUES
(1, 'News', '<p>Welcome to the Second Phase of testing on the new HFSHC site!</p>\r\n<p>Please be aware that not all features are currently working as they should - make sure to report all issues, missing information, and bugs <a href=\"https://forms.gle/Vu75WxoUwyZBvhvh9\">here</A> https://forms.gle/Vu75WxoUwyZBvhvh9. Any and all information you can provide will only help to make our new site better!</p>\r\n<p>If you have any questions or immediate issues please contact JaneKing directly via Discord or the HFSHC Community Center.  </p>', 0, 'Admin', 0),
(2, 'Help', 'This is a help page.', 0, 'Admin', 0),
(3, 'FAQ', '1. Why?<br/>\r\nA. Because.', 0, 'Admin', 0),
(8, 'Event House', '<p>Event House Details</p>\r\n<p> </p>\r\n<p> </p>\r\n<p><a title=\"Create an Event\" href=\"../../city/events/create\">Create an Event</a></p>', 0, 'Admin', 0),
(9, 'New Member Center', '<p>Welcome to Hurricane Farms SIM Horse Club! HFSHC is a very exciting game, but it can also be quite confusing. This game is based on the real horse world, and has a lot of rules about breeding, buying, selling and showing. These rules can be a bit confusing to new members, and it takes some time to learn all of the ins and outs of the game, but we hope that our New Member Center will help teach you a few tips on how to play HFSHC.<BR><BR><B>What You Start With...</B><BR><ul>· (5) Creation Credits - Used to \"Create\" new horses. These can be broken down into 3 adoption credits each.<BR>· $100,000 in SIM $ automatically created into your checking account with the Grand Bank.<BR>· $10,000 in SIM $ as your monthly salary, this is automatically added monthly.<BR>· Placement into one of three \"Houses\" - Eclipse, King or Milton.</ul><BR><B>Registering Horses</B><BR><ul>When you first join HFSHC, you are able to \"create\" some new horses with your Creation Credits. You get to pick the name, age, breed, gender of horses that will be registered to you! Please note that HFSHC is a realistic game so when selecting your horses \"stats\" please make sure you are being realistic about breed and color. Just visit I.D. Horse and follow the links to \"Register a Horse\".<BR><BR>You can choose to use all of your new member Creation Credits, save them or use them to adopt horses from the Humane Society. Each Creation Credit breaks down into 3 Adoption Credits. Keep in mind that Creation Credits are hard to come by in this game; you can earn more by completing Active Member Incentive goals, participating in club activities that offer credits, completing Achievements (system not yet implemented) or by purchasing Creation Credit packs.<BR><BR>There are also other ways to receive horses - you can purchase them from other member for SIM $, use Adoption Credits to adopt horses from the Humane Society or breed two existing horses together to create a foal (from horses you own or have permission to use from the horses owner).</ul><BR><B>Buying Horses</B><BR><ul>Horses are usually listed under the \"Sales Arena\" forum on the Community Center, in I.D. Horse where they can be marked \"For Sale\" or posted in the \"Colosseum\" where they can be auctioned. If you are interested in purchasing a horse from a member through the Community Center generally all you need to do is respond to the post and come up to an agreeable purchase amount with the horses current owner. Afterwards simply send that member a check through the Grand Bank and wait until the current horse owner transfers the horse over to you. If you are bidding on a horse in the Colosseum, you will need to be the member with the highest bid that is above the reserve price. If those conditions are met, send a check to the owner of the horse through the Grand Bank and await for the horse to be transferred to you.</ul><BR><B>Adopting Horses from the Humane Society</B><BR><ul>Simply navigate to the \"Humane Society\" and look through the horses available there. Once you find a horse you are interested in adopting, click on the horse\'s profile and click on \"Adopt This Horse\". The horse will be transferred over to you as long as you have at least 1 Adoption Credit. To search the Humane Society for a specific criteria, the easiest way to do so would be to search in I.D. Horse for the stats you want and click on the \"Adoptable\" option to see if there are any horses currently adoptable that meet your standards.</ul><BR><B>Transferring Horses</B><BR><ul>If you sell a horse, you must \"transfer\" it to the new owner after you have deposited the check for the horses purchase. This is quite simple using our automated transfer service. Only the seller can transfer the horse. You must navigate to the horse\'s profile that you are transferring and click on the link to \"Transfer Horse\". This will bring you to a page where you select who you want to send the horse to. Use the drop down menu first to determine if you are transferring this horse to a member, the Humane Society, the Retirement Home, the Cemetery or the Export Brokerage Firm. When transferring a horse to another member be sure to include the member ID of the person you\'re sending the horse to. Click on \"Transfer Horse\" when you\'re ready and the horse will be sent to the specified account.<BR><BR>Please be sure that you have already received payment for the horse before transferring any horse. You will want to settle any issues with the sale before you transfer a horse.<BR><BR>If you have bought or sold a horse and have not received either the money promised or the horse promised, please contact the Committee at officals@HFSHC.com to have the matter resolved.</ul><BR><B>Required Care for your Horses</B><BR><UL><B>Stabling</B><ul>You must board your registered horses with an approved stable, this can either be a stable that you own or a boarding stabled owned by another member. If you do not have your horses stabled you cannot send them in for vet or farrier care and they will not be able to enter any shows/races or breed. Failing to provide a stable for your horses can also result in them being confiscated by the Humane Society.<BR><BR>To Stable your horse at a facility you own navigate to the horse\'s profile and select your stable from the drop down list. If you are boarding your horse at another members stable, they will have to do this.</ul><BR><B>Veterinarian Care</B><ul>Every horse must have the \"Required Annual Care\" package. This includes all the necessary care for 12 months (a health certificate, vaccinations twice yearly as well as pre-competition, competition, brood and stallion related care.<BR><BR>To set up an appointment for the Vet, navigate to your horse\'s profile and click on \"Vet\" under the horse care section.</ul><BR><B>Farrier Care</B><ul>Suitable farrier servives for your horse\'s lifestyle must be provided and these packages are also bought annually. We\'ve trimmed down the option to two; \"Basic Care\" for horses under the age of three who are not showing and non-competing horses and \"Performance/Race Package\" for horses over the age of two who are competing.<BR><BR>To set up an appointment for the Farrier, navigate to your horse\'s profile and click on \"Farrier\" under the horse care section.</ul></ul></p>', 0, 'Admin', 0),
(10, 'Rules to Play By', '<p>Rules</p>\r\n<p>Just testing some new/old icons here... </p>\r\n<p> </p>\r\n<p><img src=\"https://i.imgur.com/U4VYVy5.gif\"></p>\r\n<p><img src=\"https://i.imgur.com/WNNBZbM.gif\"> <img src=\"https://i.imgur.com/Su6k0T7.gif\"> <img src=\"https://i.imgur.com/eqy4MHb.gif\"> <img src=\"https://i.imgur.com/PwShxY2.gif\"></p>\r\n<p><img src=\"https://i.imgur.com/SR9WJ3E.gif\"> <img src=\"https://i.imgur.com/IXjHLre.gif\"> <img src=\"https://i.imgur.com/7dq7jQe.gif\"></p>\r\n<p><img src=\"https://i.imgur.com/1VX8vgX.gif\"></p>\r\n<p><img src=\"https://i.imgur.com/3RY0S77.gif\"></p>', 0, 'Admin', 0),
(11, 'Mentor Program', '<p>The Mentor program was developed to help give assistance to members of the game. If you need help with general game rules, regulations or responsibilities a Mentor should be able to easily help you find the answer. Some of our mentors are even able to help with Graphics and Spreadsheet problems and questions.<BR><BR>Please don\'t hesitate to reach out to any mentor with any trouble you may be having, we\'re always here to help!</p>\r\n<p> </p>\r\n<p> </p>\r\n<p><B>Ariadne (Elise) - Eclipse House</B></p>\r\n<p><table width=\"100%\" border=\"0\"></p>\r\n<p><TR></p>\r\n<p><TD width=\"20%\" valign=\"top\" rowspan=\"2\"><img src=\"http://www.hfshc.com/mentors/ariadne.png\" border=\"1\"></TD></p>\r\n<p><TD colspan=\"2\" valign=\"top\"><I>I stumbled across HF in 2005 looking for a way to make horses a part of my life since they weren\'t in real life. Despite periods of inactivity, I\'ve always come back to HF because of the community and the horses. I\'m always looking for ways to help out HF and our group of wonderful horse people.</I></TD></p>\r\n<p></TR><TR></p>\r\n<p><TD width=\"40%\" valign=\"top\"><B>Player ID</B>: ??<BR><B>Discord</B>: Ariadne #8135<BR><B>Email</B>: hfshc.ariadne@gmail.com</TD></p>\r\n<p><TD width=\"40%\" valign=\"top\"><b>· Can help with General Rules</b><BR><b>· Can help with Showing/Racing Rules</b><BR><b>· Can help with Breeding Rules</b><BR><b>· Can help with HTML</b><BR><b>· Can help with Spreadsheets</b></TD></TR></table></p>\r\n<p> </p>\r\n<p> </p>\r\n<p><B>JaneKing (Jane) - King House</B></p>\r\n<p><table width=\"100%\" border=\"0\"></p>\r\n<p><TR></p>\r\n<p><TD width=\"20%\" valign=\"top\" rowspan=\"2\"><img src=\"http://www.hfshc.com/mentors/jane.png\" border=\"1\"></TD></p>\r\n<p><TD colspan=\"2\" valign=\"top\"><I>I started playing HF back in 1999 and my addiction to the game has continued to grow. I\'ve played under a few different usernames; but it wasn\'t until 2003 that I rejoined after a period of inactivity and became known as JaneKing. Over the years I\'ve also assisted HF on the backend; managing the Grand Bank, Ideal Dreams, SCARAB, AMI, SIM Updates, EBF, ID Horse as well as other mixed jobs that help HF move along. I\'d like to say it\'s quite known that I absolutely love HF and will always offer to help it and its members in any way I can.</I></TD></TR><TR></p>\r\n<p><TD width=\"40%\" valign=\"top\"><B>Player ID</B>: ??<BR><B>Discord</B>: JaneKingHF #2639<BR><B>Email</B>: spyderwebstable@yahoo.com</TD></p>\r\n<p><TD width=\"40%\" valign=\"top\"><b>· Can help with General Rules</b><BR><b>· Can help with Showing/Racing Rules</b><BR><b>· Can help with Breeding Rules</b><BR><b>· Can help with HTML</b><BR><b>· Can help with Graphics</b></TD></TR></table></p>', 0, 'Admin', 0),
(12, 'The Committee', '<p>The HFSHC Committee are a group of members who oversee various functions of the game... </p>\r\n<p> </p>\r\n<p><strong>· Member Affairs</strong>: Ariadne, Cdeer, JaneKing</p>\r\n<p><strong>· Database Administration & Development</strong>: Cdeer & JaneKing</p>\r\n<p><strong>· I.D. Horse</strong>: JaneKing</p>\r\n<p><strong>· Grand Bank</strong>: JaneKing</p>\r\n<p><strong>· Ideal Dreams</strong>: JaneKing</p>\r\n<p><strong>· Events House</strong>: Ariadne & JaneKing</p>\r\n<p><strong>· SIM Horse Standards</strong>: JaneKing</p>', 0, 'Admin', 0),
(13, 'Credits', '<p><center><a href=\"https://www.paypal.me/HFSHCcom\" target=\"new window\"><img src=\"https://i.imgur.com/DZWNri8.png\" border=\"0\" name=\"submit\" alt=\"Donate via PayPal\" xss=removed></A></center> <B>Donate today and receive a Creation Credit for every $5. USD!</B></p>', 0, 'Admin', 0),
(14, 'Active Member Incentive (AMI)', '<p>Coming soon.</p>', 0, 'Admin', 0),
(15, 'Humane Society', '<p>Coming Soon</p>', 0, 'Admin', 0);
