(6, 15, 50, '2019-05-30 04:01:36', 1000000, '4 plus years', 'To buy a Boarding Stable\n', 'Using my $10,000 monthly income then supplementing with additional payments throughout the year. I expect to make 100 payments which translates to 8.3ish years.', '$10,000 month from income tier, large base of throughbred breeding stock/SHS mares to sell years', 'I \"own\" Timberwick', 'Should this be optional?', 1, 0),
