(9, 19, 62, '2019-06-02 15:43:11', 1000000, '4 plus years', 'To buy a Private Stable\n', 'Beg for money?  I\'ll make a payment, like, once a year.', 'I\'m a tier E, so like I\'m really banking some good money right now.', 'I\'m more of a \"free range\" type of boarder.', 'Pretty please? :D', 1, 0),
