(1, 3, 'Test First Business', 'Business', '<div class=\"wrapper row1\"><header id=\"header\" class=\"clear\">\r\n<h1>Testing, Testing!  <a href=\"http://www.hfshc.com\">Looky here</a>! </h1>\r\n</header></div>', 0, 0),
(4, 1, 'Arabian Association', 'Association', 'This is a brand new CAB. Please allow the owner time to put up a page :)', 0, 0),
(5, 3, 'Pretty Pony Club', 'Club', 'This is a brand new CAB. Please allow the owner time to put up a page :)', 0, 0),
(6, 14, 'Appaloosa Horse Association ', 'Club', 'This is a brand new CAB. Please allow the owner time to put up a page :)', 0, 0),
(7, 13, 'Standardbred Harness Racing Association', 'Association', '<p><strong>W E L C O M E</strong> to the Standardbred Harness Racing Association, home of Standardbred racing in HFSHC! The SHRA has been an active community in the game for many years. If you\'re new to the SHRA please browse the links above, especially the \"Racing 101\" link. This will give more information about the sport itself, including help for information about retraining your racers after retirement. Once you\'ve learned everything you need to know about the sport, be sure to join!<br><br>The SHRA is working on many new features that will be available during the 2020 year, including a Studbook, Broodbook and full rankings system. We\'re slowly rolling out a new database that will hold all the results from races through the years in HFSHC. As you can imagine this takes time, so the overall rankings systems will be outdated as older stats are added in. We\'re hoping that by the end of 2021 we\'ll have every race uploaded in time to roll out our stud and brood book.<br><br><strong>What are the benefits of this new database?</strong> As you can see from the current horse pages, live updating can be done much easier. A simple upload to a system allows for auto-calculating of tokens, earnings and overall rank. Members no longer have to contact someone to find where their horse ranks in any given year - it\'s updated as shows are run! <br><br>Welcome to the SHRA in 2021 - ride hard!<br><br>-<strong>CDeer</strong></p>', 0, 0),
(8, 14, 'Western competitive trail', 'Club', 'This is a brand new CAB. Please allow the owner time to put up a page :)', 0, 0),
(9, 19, 'Horses with Stupid Names', 'Club', '<h1><span xss=removed><strong>Horses with Stupid Names!</strong></span></h1>\r\n<p>You know you want to join this exclusive club!</p>\r\n<table border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\"><strong>Rules</strong></td>\r\n</tr>\r\n<tr>\r\n<td>1.</td>\r\n<td>There are no rules!!</td>\r\n</tr>\r\n<tr>\r\n<td>2.</td>\r\n<td>????</td>\r\n</tr>\r\n</tbody>\r\n</table>', 0, 0),
(11, 12, 'The Arabian Horse Society', 'Association', 'This is a brand new CAB. Please allow the owner time to put up a page :)', 0, 0),
(12, 3, 'Eventing Association #1', 'Association', 'This is a brand new CAB. Please allow the owner time to put up a page :)', 0, 0),
(13, 26, 'The Cool Club', 'Club', 'This is a brand new CAB. Please allow the owner time to put up a page :)', 0, 0),
